                                    required: "Email is required",
                                    pattern: {
                                        value: /^[^\s@]+@[^\s@]+\.[^\s@]+$/,
                                        message: "Invalid email address"
                                    }
                                })}
                            />
                            {errors.email && (
                                <p className="error_mssg">{errors.email.message}</p>
                            )}
                        </label>




                        <label htmlFor="details-wachtwoord">
                            Wachtwoord :
